\u6700\u5E38\u89C1\u7684\u6CE8\u91CA\u5F62\u5F0F\uFF0C\u4F60\u53EF\u4EE5\u5728\u4EFB\u4F55\u5730\u65B9\u4F7F\u7528\u4EE5 // \u5F00\u5934\u7684\u5355\u884C\u6CE8\u91CA\u3002\u591A\u884C\u6CE8\u91CA\u4E5F\u53EB\u5757\u6CE8\u91CA\uFF0C\u5747\u5DF2\u4EE5 /* \u5F00\u5934\uFF0C\u5E76\u4EE5 */ \u7ED3\u5C3E\uFF0C\u4E14\u4E0D\u53EF\u4EE5\u5D4C\u5957\u4F7F\u7528\uFF0C\u591A\u884C\u6CE8\u91CA\u4E00\u822C\u7528\u4E8E\u5305\u7684\u6587\u6863\u63CF\u8FF0\u6216\u6CE8\u91CA\u6210\u5757\u7684\u4EE3\u7801\u7247\u6BB5\u3002</li><li>\u4E0B\u4E00\u884C fmt.Println(...) \u53EF\u4EE5\u5C06\u5B57\u7B26\u4E32\u8F93\u51FA\u5230\u63A7\u5236\u53F0\uFF0C\u5E76\u5728\u6700\u540E\u81EA\u52A8\u589E\u52A0\u6362\u884C\u5B57\u7B26 \\n\u3002 \u4F7F\u7528 fmt.Print(&quot;hello, world\\n&quot;) \u53EF\u4EE5\u5F97\u5230\u76F8\u540C\u7684\u7ED3\u679C\u3002 Print \u548C Println \u8FD9\u4E24\u4E2A\u51FD\u6570\u4E5F\u652F\u6301\u4F7F\u7528\u53D8\u91CF\uFF0C\u5982\uFF1Afmt.Println(arr)\u3002\u5982\u679C\u6CA1\u6709\u7279\u522B\u6307\u5B9A\uFF0C\u5B83\u4EEC\u4F1A\u4EE5\u9ED8\u8BA4\u7684\u6253\u5370\u683C\u5F0F\u5C06\u53D8\u91CF arr \u8F93\u51FA\u5230\u63A7\u5236\u53F0\u3002</li><li>\u5F53\u6807\u8BC6\u7B26\uFF08\u5305\u62EC\u5E38\u91CF\u3001\u53D8\u91CF\u3001\u7C7B\u578B\u3001\u51FD\u6570\u540D\u3001\u7ED3\u6784\u5B57\u6BB5\u7B49\u7B49\uFF09\u4EE5\u4E00\u4E2A\u5927\u5199\u5B57\u6BCD\u5F00\u5934\uFF0C\u5982\uFF1AGroup1\uFF0C\u90A3\u4E48\u4F7F\u7528\u8FD9\u79CD\u5F62\u5F0F\u7684\u6807\u8BC6\u7B26\u7684\u5BF9\u8C61\u5C31\u53EF\u4EE5\u88AB\u5916\u90E8\u5305\u7684\u4EE3\u7801\u6240\u4F7F\u7528\uFF08\u5BA2\u6237\u7AEF\u7A0B\u5E8F\u9700\u8981\u5148\u5BFC\u5165\u8FD9\u4E2A\u5305\uFF09\uFF0C\u8FD9\u88AB\u79F0\u4E3A\u5BFC\u51FA\uFF08\u50CF\u9762\u5411\u5BF9\u8C61\u8BED\u8A00\u4E2D\u7684 public\uFF09\uFF1B\u6807\u8BC6\u7B26\u5982\u679C\u4EE5\u5C0F\u5199\u5B57\u6BCD\u5F00\u5934\uFF0C\u5219\u5BF9\u5305\u5916\u662F\u4E0D\u53EF\u89C1\u7684\uFF0C\u4F46\u662F\u4ED6\u4EEC\u5728\u6574\u4E2A\u5305\u7684\u5185\u90E8\u662F\u53EF\u89C1\u5E76\u4E14\u53EF\u7528\u7684\uFF08\u50CF\u9762\u5411\u5BF9\u8C61\u8BED\u8A00\u4E2D\u7684 protected \uFF09\u3002</li></ol></blockquote><hr><h3 id="_5-3-\u6267\u884C\u4EE3\u7801" tabindex="-1"><a class="header-anchor" href="#_5-3-\u6267\u884C\u4EE3\u7801" aria-hidden="true">#</a> 5.3 \u6267\u884C\u4EE3\u7801</h3><ol><li><p>\u6211\u4EEC\u8FD8\u53EF\u4EE5\u4F7F\u7528 <strong>go build</strong> \u547D\u4EE4\u6765\u751F\u6210\u4E8C\u8FDB\u5236\u6587\u4EF6\uFF1A</p><p>windows\u4E0B\u9762\u751F\u6210\`\`exe<code> \u6587\u4EF6 \uFF0CLinux\u4E0B\u751F\u6210</code>sh\` \u65E0\u540E\u7F00\u7684\u53EF\u6267\u884C\u6587\u4EF6</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>$ go build hello.go 
